import styled from "@emotion/styled";

export const Label = styled.label`
  font-size: 30px;
`;

export const Form = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
`;

export const FormInput = styled.input`
  border: 2px solid gray;
  border-radius: 20px;
`;
